const words = $('Transcribe Audio').first().json.words;
const result = [];

for (let i = 0; i < words.length; i += 3) {
  const chunk = words.slice(i, i + 3);
  result.push({
    words: chunk.map(
      word => word.word.charAt(0).toUpperCase() + word.word.slice(1)
    ).join(' '),
    start: chunk[0].start,
    end: chunk[chunk.length - 1].end,
  });
}

return {
  json: {
    chunks: result,
  },
};
